                <nav 
                className="navbar navbar-expand-md navbar-dark bg-dark fixed-top"
                css={css`
      padding: 32px;
      background-color: hotpink;
      font-size: 24px;
      border-radius: 4px;
    `}
>
                    <a>
                        Pokemon
                    </a>
                </nav>
            </div>
        )
    }
}
